var symbolUrl = 'data:image/png;base64,';
var presents = ['圣诞树', '贺卡', '圣诞礼盒', '围巾', '袜子', '苹果', '手链', '巧克力', '玫瑰', '香水', '乐高', '芭比', '项链', '抱枕', '变形金刚', '摆件', '魔方', '文具', '棒棒糖', '蓝牙耳帽', '超级飞侠', '暖手宝', '夜灯', '堆袜', '耳钉', '公仔', '手机壳', '八音盒', '剃须刀', '打火机', '手表', '巴克球', '模型', '音响', '蒙奇奇', '保温杯']

var data = [];
for (var i = 0; i < presents.length; ++i) {
    data.push({
        name: presents[i],
        value: (presents.length - i) * 20
    });
}
for (var i = 10; i < presents.length; ++i) {
    var cnt = Math.floor(Math.random() * 10);
    for (var j = 0; j < cnt; ++j) {
        data.push({
            name: presents[i],
            value: Math.random() * 10
        });
    }
}

var maskImage = new Image();
maskImage.onload = function() {
    myChart.setOption({
        tooltip: {
            show: true
        },
        grid: {
            left: 0,
            bottom: 0,
            top: 0,
            right: 0,
        },
        xAxis: {
            type: "category",
            show: false
        },
        yAxis: {
            max: 100,
            show: false
        },
        series: [{
                zlevel: -1,
                type: 'pictorialBar',
                name: 'pictorial',
                silent: true,
                symbol: 'image://' + symbolUrl,
                symbolSize: ['40.2%', '45.2%'],
                symbolPosition: 'center',
                barWidth: '100%',
                barMaxWidth: '100%',
                itemStyle: {
                    normal: {
                        opacity: 0.2
                    }
                },
                data: [{
                    value: 100
                }]
            },
            {
                type: 'wordCloud',
                sizeRange: [8, 60],
                rotationRange: [-30, 30],
                maskImage: maskImage,
                textPadding: 0,
                gridSize: 5,
                width: '40%',
                height: '45%',
                left: 'center',
                top: 'center',
                drawOutOfBound: false,
                textStyle: {
                    normal: {
                        color: function() {
                            return 'rgb(' + [
                                Math.round(Math.random() * 160),
                                Math.round(Math.random() * 160),
                                Math.round(Math.random() * 160)
                            ].join(',') + ')';
                        }
                    },
                },
                data: data
            },
        ]
    });
};
maskImage.src = symbolUrl;